import React from 'react';
import { useState, useEffect } from 'react';
import "./css/profile.css"
import {getCurrentUser} from "../services/auth.service";
import {getTourist} from "../services/tourist.service";
import albedo from './albedo.jpg';
import {TouristDet} from './Tourist-det'
import Pagination from '@mui/material/Pagination';

interface TouristAPI {
    data: any
    headers: Object
}

const Profile: React.FC = () => {
    const currentUser = getCurrentUser();
    const [touristList, setTouristList] = useState<TouristAPI>();

    useEffect(() => {
        getTourist().then((value) => {
            console.log(value);
            setTouristList(value as TouristAPI);
        })
    }, []);

    return (
        <div>
            <div className="profile-header">
                <div>
                    <img className="prof-pic" src={albedo}/>
                </div>
                <div style={{marginTop:20, marginLeft:25}}>
                    <header>
                        <h3>
                            {currentUser.Name}
                            <hr/>
                        </h3>
                    </header>
                    <p className="prof-detail">
                        <strong>Email: </strong> {currentUser.Email}
                        <br/>
                        <strong> Page: </strong> {touristList?.data.page}
                    </p>
                </div>
            </div>
            <div className="tourist-list">
                <h3>
                    Tourist List
                    <hr/>
                </h3>
                <Pagination count={10} shape="rounded" showFirstButton showLastButton/>
                <TouristDet 
                    name="Mirda Nabila Nurilah" 
                    location='Kelapa Gading, Jakarta' 
                    email="mirdanabilan@gmail.com" 
                    profpic={albedo}/>
                <TouristDet 
                    name="Mirda Nabila Nurilah" 
                    location='Kelapa Gading, Jakarta' 
                    email="mirdanabilan@gmail.com" 
                    profpic={albedo}/>
                <TouristDet 
                    name="Mirda Nabila Nurilah" 
                    location='Kelapa Gading, Jakarta' 
                    email="mirdanabilan@gmail.com" 
                    profpic={albedo}/>
            </div>
        </div>
        
    );
}; export default Profile;
